import { Link } from "react-router-dom";

export const SublimationInfoBox = () => {
  return (
    <div className="sublimation-info-box">
      <div>
        <h1>What is Sublimation?</h1>
        <p>
          Sublimation is the process of channeling negative thoughts of stress
          or sadness into creative forms of expression to alleviate depression.
          Project Sublime was made by teenage students who had experienced forms
          of depression in the past and found a creative outlet to help
        </p>
        <Link className="btn btn-outline-secondary" to={"/sublimation"}>
          Hear our stories
        </Link>
      </div>
      <div className="product-device shadow-sm d-none d-md-block"></div>
      <div className="product-device product-device-2 shadow-sm d-none d-md-block"></div>
    </div>
  );
};
